import React from 'react';
import './App.css';
import HomePage from '../src/pages/home-page/homepage.component';

import { BrowserRouter, Switch, Route } from 'react-router-dom';

const HatPage = (props) => (
  console.log(props),
  <div>
	<h1>Hats Page</h1>
  </div>
);

function App() {
  return (
	<div className="App">
	<BrowserRouter>
		<Switch>
			<Route exact path='/' component={HomePage} />
			<Route exact path='/hats' component={HatPage} />
		</Switch>
	</BrowserRouter>

    </div>
  );
}

export default App;
